package site.yolowa.dto;

public class MypageHeaderCount {
	private int wishlistCount;
	private int messageCount;
	private int reviewCount;
	private int reservationCount;
	private int loginMemberNo;
	
	public MypageHeaderCount() {
		// TODO Auto-generated constructor stub
	}

	public int getWishlistCount() {
		return wishlistCount;
	}

	public void setWishlistCount(int wishlistCount) {
		this.wishlistCount = wishlistCount;
	}

	public int getMessageCount() {
		return messageCount;
	}

	public void setMessageCount(int messageCount) {
		this.messageCount = messageCount;
	}

	public int getReviewCount() {
		return reviewCount;
	}

	public void setReviewCount(int reviewCount) {
		this.reviewCount = reviewCount;
	}

	public int getReservationCount() {
		return reservationCount;
	}

	public void setReservationCount(int reservationCount) {
		this.reservationCount = reservationCount;
	}

	public int getLoginMemberNo() {
		return loginMemberNo;
	}

	public void setLoginMemberNo(int loginMemberNo) {
		this.loginMemberNo = loginMemberNo;
	}
	
	
}
